import React, { Component } from 'react';

class CurrencyTable extends React.Component {
    constructor (props) {
        super(props);
    }

    render() {
        return (
          <div>
              <table className=".table">
                  <tr>
                    <thead>Base Currency</thead>
                    <thead>Value</thead>
                  </tr>
                  <tr>
                    <td></td>
                    <td></td>

                  </tr>
              </table>
          </div>
        );  
    }
}

export default CurrencyTable;
